import React from 'react'
import { Switch, Route, useRouteMatch } from 'react-router-dom';
import Devices from '../components/Devices/Devices';
import Requests from '../components/Admin/Requests'
import ListUsers from '../components/Admin/ListUsers'
import Tracking from '../components/Admin/Tranking'
import ManaDevives from '../components/Admin/[M]Devives'
export default function AdminRouter() {
    return (
        <div>
            <Switch>
                <Route path='/admindashboard/managedevices' component={ManaDevives} />
                <Route path='/admindashboard/manageRQ' component={Requests} />
                <Route path='/admindashboard/manageUser' component={ListUsers} />
                <Route path='/admindashboard/devicestracking' component={Tracking} />
            </Switch>
        </div>
    )
}
